  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `is_language_switcher` tinyint(1) NOT NULL DEFAULT 1,
  `page_terms_id` bigint(20) unsigned DEFAULT NULL,
  `page_policy_id` bigint(20) unsigned DEFAULT NULL,
  `logo_id` bigint(20) unsigned DEFAULT NULL,
  `copyrights` text DEFAULT NULL,
  `social_facebook` varchar(191) DEFAULT NULL,
  `social_twitter` varchar(191) DEFAULT NULL,
  `social_instagram` varchar(191) DEFAULT NULL,
  `social_linkedin` varchar(191) DEFAULT NULL,
  `social_pinterest` varchar(191) DEFAULT NULL,
  `social_youtube` varchar(191) DEFAULT NULL,
  `social_github` varchar(191) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `settings_footer_logo_id_foreign` (`logo_id`),
  KEY `settings_footer_page_terms_id_foreign` (`page_terms_id`),
  KEY `settings_footer_page_policy_id_foreign` (`page_policy_id`),
  CONSTRAINT `settings_footer_logo_id_foreign` FOREIGN KEY (`logo_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `settings_footer_page_policy_id_foreign` FOREIGN KEY (`page_policy_id`) REFERENCES `pages` (`id`),
  CONSTRAINT `settings_footer_page_terms_id_foreign` FOREIGN KEY (`page_terms_id`) REFERENCES `pages` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_general`;
CREATE TABLE `settings_general` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(60) NOT NULL DEFAULT 'Riverr',
  `subtitle` varchar(120) NOT NULL DEFAULT 'Freelance Services Marketplace',
  `separator` varchar(5) NOT NULL DEFAULT '|',
  `logo_id` bigint(20) unsigned DEFAULT NULL,
  `logo_dark_id` bigint(20) unsigned DEFAULT NULL,
  `favicon_id` bigint(20) unsigned DEFAULT NULL,
  `header_announce_text` text DEFAULT NULL,
  `header_announce_link` text DEFAULT NULL,
  `is_language_switcher` tinyint(1) NOT NULL DEFAULT 1,
  `default_language` varchar(2) NOT NULL DEFAULT 'en',
  PRIMARY KEY (`id`),
  KEY `settings_general_logo_id_foreign` (`logo_id`),
  KEY `settings_general_favicon_id_foreign` (`favicon_id`),
  KEY `settings_general_logo_dark_id_foreign` (`logo_dark_id`),
  CONSTRAINT `settings_general_favicon_id_foreign` FOREIGN KEY (`favicon_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `settings_general_logo_dark_id_foreign` FOREIGN KEY (`logo_dark_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `settings_general_logo_id_foreign` FOREIGN KEY (`logo_id`) REFERENCES `file_manager` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_hero`;
CREATE TABLE `settings_hero` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `enable_bg_img` tinyint(1) NOT NULL DEFAULT 0,
  `bg_large_id` bigint(20) unsigned DEFAULT NULL,
  `bg_medium_id` bigint(20) unsigned DEFAULT NULL,
  `bg_small_id` bigint(20) unsigned DEFAULT NULL,
  `bg_color` varchar(15) NOT NULL DEFAULT '#a1a1aa',
  `bg_large_height` int(11) NOT NULL DEFAULT 570,
  `bg_small_height` int(11) NOT NULL DEFAULT 250,
  PRIMARY KEY (`id`),
  KEY `settings_hero_bg_large_id_index` (`bg_large_id`),
  KEY `settings_hero_bg_medium_id_index` (`bg_medium_id`),
  KEY `settings_hero_bg_small_id_index` (`bg_small_id`),
  CONSTRAINT `settings_hero_bg_large_id_foreign` FOREIGN KEY (`bg_large_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `settings_hero_bg_medium_id_foreign` FOREIGN KEY (`bg_medium_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `settings_hero_bg_small_id_foreign` FOREIGN KEY (`bg_small_id`) REFERENCES `file_manager` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_media`;
CREATE TABLE `settings_media` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `requirements_file_max_size` int(11) NOT NULL DEFAULT 50,
  `requirements_file_allowed_extensions` text NOT NULL,
  `delivered_work_max_size` int(11) NOT NULL DEFAULT 50,
  `portfolio_max_images` int(11) NOT NULL DEFAULT 10,
  `portfolio_max_size` int(11) NOT NULL DEFAULT 5,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_publish`;
CREATE TABLE `settings_publish` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `auto_approve_gigs` tinyint(1) NOT NULL DEFAULT 0,
  `auto_approve_portfolio` tinyint(1) NOT NULL DEFAULT 0,
  `max_tags` int(11) NOT NULL DEFAULT 5,
  `is_video_enabled` tinyint(1) NOT NULL DEFAULT 1,
  `is_documents_enabled` tinyint(1) NOT NULL DEFAULT 1,
  `max_documents` int(11) NOT NULL DEFAULT 2,
  `max_document_size` int(11) NOT NULL DEFAULT 10,
  `max_images` int(11) NOT NULL DEFAULT 5,
  `max_image_size` int(11) NOT NULL DEFAULT 5,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_security`;
CREATE TABLE `settings_security` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `is_recaptcha` tinyint(1) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_seo`;
CREATE TABLE `settings_seo` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `description` text DEFAULT NULL,
  `facebook_page_id` varchar(60) DEFAULT NULL,
  `facebook_app_id` varchar(60) DEFAULT NULL,
  `twitter_username` varchar(60) DEFAULT NULL,
  `ogimage_id` bigint(20) unsigned DEFAULT NULL,
  `is_sitemap` tinyint(1) NOT NULL DEFAULT 1,
  PRIMARY KEY (`id`),
  KEY `settings_seo_ogimage_id_foreign` (`ogimage_id`),
  CONSTRAINT `settings_seo_ogimage_id_foreign` FOREIGN KEY (`ogimage_id`) REFERENCES `file_manager` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `settings_withdrawal`;
CREATE TABLE `settings_withdrawal` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `min_withdrawal_amount` int(11) NOT NULL DEFAULT 10,
  `withdrawal_period` enum('daily','weekly','monthly') NOT NULL DEFAULT 'daily',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `stripe_settings`;
CREATE TABLE `stripe_settings` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT 'Stripe',
  `is_enabled` tinyint(1) NOT NULL DEFAULT 0,
  `logo_id` bigint(20) unsigned DEFAULT NULL,
  `currency` varchar(20) NOT NULL DEFAULT 'USD',
  `exchange_rate` decimal(8,2) NOT NULL DEFAULT 1.00,
  `deposit_fee` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `stripe_settings_logo_id_foreign` (`logo_id`),
  CONSTRAINT `stripe_settings_logo_id_foreign` FOREIGN KEY (`logo_id`) REFERENCES `file_manager` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `subcategories`;
CREATE TABLE `subcategories` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(20) NOT NULL,
  `parent_id` bigint(20) unsigned NOT NULL,
  `name` varchar(60) NOT NULL,
  `slug` varchar(60) NOT NULL,
  `description` text DEFAULT NULL,
  `icon_id` bigint(20) unsigned DEFAULT NULL,
  `image_id` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `subcategories_uid_unique` (`uid`),
  UNIQUE KEY `subcategories_name_unique` (`name`),
  UNIQUE KEY `subcategories_slug_unique` (`slug`),
  KEY `subcategories_parent_id_foreign` (`parent_id`),
  KEY `subcategories_icon_id_foreign` (`icon_id`),
  KEY `subcategories_image_id_foreign` (`image_id`),
  CONSTRAINT `subcategories_icon_id_foreign` FOREIGN KEY (`icon_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `subcategories_image_id_foreign` FOREIGN KEY (`image_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `subcategories_parent_id_foreign` FOREIGN KEY (`parent_id`) REFERENCES `categories` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `support_messages`;
CREATE TABLE `support_messages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `ip_address` varchar(45) DEFAULT NULL,
  `user_agent` text DEFAULT NULL,
  `name` varchar(60) NOT NULL,
  `email` varchar(60) NOT NULL,
  `subject` varchar(120) NOT NULL,
  `message` longtext NOT NULL,
  `is_seen` tinyint(1) NOT NULL DEFAULT 0,
  `is_replied` tinyint(1) NOT NULL DEFAULT 0,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `tagging_tagged`;
CREATE TABLE `tagging_tagged` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `taggable_id` int(10) unsigned NOT NULL,
  `taggable_type` varchar(125) NOT NULL,
  `tag_name` varchar(125) NOT NULL,
  `tag_slug` varchar(125) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `tagging_tagged_taggable_id_index` (`taggable_id`),
  KEY `tagging_tagged_taggable_type_index` (`taggable_type`),
  KEY `tagging_tagged_tag_slug_index` (`tag_slug`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `tagging_tags`;
CREATE TABLE `tagging_tags` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `slug` varchar(125) NOT NULL,
  `name` varchar(125) NOT NULL,
  `suggest` tinyint(1) NOT NULL DEFAULT 0,
  `count` int(10) unsigned NOT NULL DEFAULT 0,
  `tag_group_id` int(10) unsigned DEFAULT NULL,
  `description` text DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `tagging_tags_slug_index` (`slug`),
  KEY `tagging_tags_tag_group_id_foreign` (`tag_group_id`),
  CONSTRAINT `tagging_tags_tag_group_id_foreign` FOREIGN KEY (`tag_group_id`) REFERENCES `tagging_tag_groups` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `tagging_tag_groups`;
CREATE TABLE `tagging_tag_groups` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `slug` varchar(125) NOT NULL,
  `name` varchar(125) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `tagging_tag_groups_slug_index` (`slug`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(20) NOT NULL,
  `username` varchar(60) NOT NULL,
  `email` varchar(60) NOT NULL,
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(60) DEFAULT NULL,
  `account_type` enum('seller','buyer') NOT NULL DEFAULT 'seller',
  `avatar_id` bigint(20) unsigned DEFAULT NULL,
  `level_id` bigint(20) unsigned DEFAULT NULL,
  `provider_name` varchar(60) DEFAULT NULL,
  `provider_id` varchar(60) DEFAULT NULL,
  `country_id` bigint(20) unsigned DEFAULT NULL,
  `fullname` varchar(60) DEFAULT NULL,
  `headline` varchar(100) DEFAULT NULL,
  `description` text DEFAULT NULL,
  `status` enum('active','pending','verified','banned') NOT NULL DEFAULT 'pending',
  `balance_net` varchar(20) NOT NULL DEFAULT '0',
  `balance_withdrawn` varchar(20) NOT NULL DEFAULT '0',
  `balance_purchases` varchar(20) NOT NULL DEFAULT '0',
  `balance_pending` varchar(20) NOT NULL DEFAULT '0',
  `balance_available` varchar(20) NOT NULL DEFAULT '0',
  `remember_token` varchar(100) DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `last_activity` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_uid_unique` (`uid`),
  UNIQUE KEY `users_username_unique` (`username`),
  UNIQUE KEY `users_email_unique` (`email`),
  KEY `users_avatar_id_foreign` (`avatar_id`),
  KEY `users_level_id_foreign` (`level_id`),
  KEY `users_country_id_foreign` (`country_id`),
  CONSTRAINT `users_avatar_id_foreign` FOREIGN KEY (`avatar_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `users_country_id_foreign` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `users_level_id_foreign` FOREIGN KEY (`level_id`) REFERENCES `levels` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_availability`;
CREATE TABLE `user_availability` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `message` text DEFAULT NULL,
  `expected_available_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `user_availability_user_id_foreign` (`user_id`),
  CONSTRAINT `user_availability_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_billing`;
CREATE TABLE `user_billing` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `firstname` varchar(60) DEFAULT NULL,
  `lastname` varchar(60) DEFAULT NULL,
  `company` varchar(60) DEFAULT NULL,
  `city` varchar(60) DEFAULT NULL,
  `zip` varchar(20) DEFAULT NULL,
  `country_id` bigint(20) unsigned DEFAULT NULL,
  `address` text DEFAULT NULL,
  `vat_number` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_billing_user_id_foreign` (`user_id`),
  KEY `user_billing_country_id_foreign` (`country_id`),
  CONSTRAINT `user_billing_country_id_foreign` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `user_billing_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_languages`;
CREATE TABLE `user_languages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `name` varchar(100) NOT NULL,
  `level` enum('basic','conversational','fluent','native') NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_languages_user_id_foreign` (`user_id`),
  KEY `user_languages_name_index` (`name`),
  CONSTRAINT `user_languages_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_linked_accounts`;
CREATE TABLE `user_linked_accounts` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `facebook_profile` varchar(160) DEFAULT NULL,
  `twitter_profile` varchar(160) DEFAULT NULL,
  `dribbble_profile` varchar(160) DEFAULT NULL,
  `stackoverflow_profile` varchar(160) DEFAULT NULL,
  `github_profile` varchar(160) DEFAULT NULL,
  `youtube_profile` varchar(160) DEFAULT NULL,
  `vimeo_profile` varchar(160) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_linked_accounts_user_id_foreign` (`user_id`),
  CONSTRAINT `user_linked_accounts_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_portfolio`;
CREATE TABLE `user_portfolio` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(20) NOT NULL,
  `user_id` bigint(20) unsigned NOT NULL,
  `title` varchar(100) NOT NULL,
  `slug` varchar(160) NOT NULL,
  `description` longtext DEFAULT NULL,
  `thumb_id` bigint(20) unsigned NOT NULL,
  `project_link` varchar(120) DEFAULT NULL,
  `project_video` varchar(120) DEFAULT NULL,
  `status` enum('pending','active') NOT NULL DEFAULT 'pending',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_portfolio_uid_unique` (`uid`),
  UNIQUE KEY `user_portfolio_slug_unique` (`slug`),
  KEY `user_portfolio_user_id_foreign` (`user_id`),
  KEY `user_portfolio_thumb_id_foreign` (`thumb_id`),
  CONSTRAINT `user_portfolio_thumb_id_foreign` FOREIGN KEY (`thumb_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `user_portfolio_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_portfolio_gallery`;
CREATE TABLE `user_portfolio_gallery` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `project_id` bigint(20) unsigned NOT NULL,
  `image_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_portfolio_gallery_project_id_foreign` (`project_id`),
  KEY `user_portfolio_gallery_image_id_foreign` (`image_id`),
  CONSTRAINT `user_portfolio_gallery_image_id_foreign` FOREIGN KEY (`image_id`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `user_portfolio_gallery_project_id_foreign` FOREIGN KEY (`project_id`) REFERENCES `user_portfolio` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_skills`;
CREATE TABLE `user_skills` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `name` varchar(30) NOT NULL,
  `slug` varchar(100) NOT NULL,
  `experience` enum('beginner','intermediate','pro') NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_skills_user_id_foreign` (`user_id`),
  KEY `user_skills_slug_index` (`slug`),
  CONSTRAINT `user_skills_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_withdrawal_history`;
CREATE TABLE `user_withdrawal_history` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(20) NOT NULL,
  `user_id` bigint(20) unsigned NOT NULL,
  `gateway_provider_name` varchar(20) NOT NULL DEFAULT 'paypal',
  `gateway_provider_id` text NOT NULL,
  `amount` varchar(20) NOT NULL,
  `status` enum('pending','paid','rejected') NOT NULL DEFAULT 'pending',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_withdrawal_history_uid_unique` (`uid`),
  KEY `user_withdrawal_history_user_id_foreign` (`user_id`),
  CONSTRAINT `user_withdrawal_history_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user_withdrawal_settings`;
CREATE TABLE `user_withdrawal_settings` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `gateway_provider_name` varchar(20) NOT NULL DEFAULT 'paypal',
  `gateway_provider_id` varchar(60) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_withdrawal_settings_user_id_foreign` (`user_id`),
  CONSTRAINT `user_withdrawal_settings_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `verification_center`;
CREATE TABLE `verification_center` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(20) NOT NULL,
  `user_id` bigint(20) unsigned NOT NULL,
  `document_type` enum('id','driver_license','passport') NOT NULL,
  `file_front_side` bigint(20) unsigned NOT NULL,
  `file_back_side` bigint(20) unsigned DEFAULT NULL,
  `file_selfie` bigint(20) unsigned NOT NULL,
  `status` enum('pending','verified','declined') NOT NULL DEFAULT 'pending',
  `verified_at` timestamp NULL DEFAULT NULL,
  `declined_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  UNIQUE KEY `verification_center_uid_unique` (`uid`),
  KEY `verification_center_user_id_foreign` (`user_id`),
  KEY `verification_center_file_front_side_foreign` (`file_front_side`),
  KEY `verification_center_file_back_side_foreign` (`file_back_side`),
  KEY `verification_center_file_selfie_foreign` (`file_selfie`),
  CONSTRAINT `verification_center_file_back_side_foreign` FOREIGN KEY (`file_back_side`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `verification_center_file_front_side_foreign` FOREIGN KEY (`file_front_side`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `verification_center_file_selfie_foreign` FOREIGN KEY (`file_selfie`) REFERENCES `file_manager` (`id`),
  CONSTRAINT `verification_center_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `vnpay_settings`;
CREATE TABLE `vnpay_settings` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT 'VNPay',
  `is_enabled` tinyint(1) NOT NULL DEFAULT 0,
  `logo_id` bigint(20) unsigned DEFAULT NULL,
  `currency` varchar(20) NOT NULL DEFAULT 'VND',
  `exchange_rate` decimal(8,2) NOT NULL DEFAULT 1.00,
  `deposit_fee` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `vnpay_settings_logo_id_foreign` (`logo_id`),
  CONSTRAINT `vnpay_settings_logo_id_foreign` FOREIGN KEY (`logo_id`) REFERENCES `file_manager` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `xendit_settings`;
CREATE TABLE `xendit_settings` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT 'Xendit',
  `is_enabled` tinyint(1) NOT NULL DEFAULT 0,
  `logo_id` bigint(20) unsigned DEFAULT NULL,
  `currency` enum('IDR','PHP') NOT NULL DEFAULT 'IDR',
  `exchange_rate` decimal(8,2) NOT NULL DEFAULT 1.00,
  `deposit_fee` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `xendit_settings_logo_id_foreign` (`logo_id`),
  CONSTRAINT `xendit_settings_logo_id_foreign` FOREIGN KEY (`logo_id`) REFERENCES `file_manager` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `youcanpay_settings`;
CREATE TABLE `youcanpay_settings` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT 'YouCanPay',
  `is_enabled` tinyint(1) NOT NULL DEFAULT 0,
  `logo_id` bigint(20) unsigned DEFAULT NULL,
